import JobCard from '../components/JobCard';

const mockJobs = [
  {
    id: 1,
    title: 'Remote Graphic Designer',
    company: 'Tech Corp',
    location: 'Remote',
    type: 'Full-time',
    tags: ['Design', 'Adobe Creative Suite', 'UI/UX'],
    accommodations: ['Remote Work', 'Flexible Hours']
  },
  {
    id: 2,
    title: 'Accessibility Consultant',
    company: 'Inclusive Solutions',
    location: 'Kathmandu',
    type: 'Contract',
    tags: ['WCAG', 'Compliance', 'Training'],
    accommodations: ['Wheelchair Access', 'Sign Language']
  }
];

export default function Dashboard() {
  return (
    <div className="max-w-7xl mx-auto py-6 px-4 sm:px-6 lg:px-8">
      <h1 className="text-3xl font-bold text-gray-900 mb-8">Recommended Jobs</h1>
      <div className="grid grid-cols-1 gap-6 md:grid-cols-2 lg:grid-cols-3">
        {mockJobs.map((job) => (
          <JobCard key={job.id} job={job} />
        ))}
      </div>
    </div>
  );
}
